import React from 'react';
import Navbar from '.navbar/navbar';
import './header.css';

class Header extends React.Component{
  render(){
    return(
      <div className="bg-img">
        <div id="header" className="container">
          <Navbar/>
        </div>
      </div>
    )
  }
}
export default Header
